import { makeStyles } from "@mui/styles";



export const useStyles = makeStyles({

  container:{
    width:1200,
    margin:'0 auto',
    marginTop:'60 px',
  },
  images:{
    justifyContent:'space-between'
  },
  topic:{
    textTransform:'uppercase',
    fontSize:'16px !important',
    fontWeight:'700 !important',
  }

})
